webpackJsonp([0x81b8806e4260],{495:function(e,o){e.exports={data:{markdownRemark:{html:"<p><strong>Are you restyling your home, kitchen, hotel or restaurant</strong> – or just looking for that one lamp or rug to finish off your own scheme – we can help.</p>\n<p>We offer a complete Interior Design service to domestic and commercial clients.</p>\n<p>Sue Dann Interiors is a BIID recognised Interior Design practice led by a professional and creative designer with over 40 years design experience.</p>\n<hr>\n<p>The company was founded in 1998 in Buckinghamshire and serviced the Home Counties and London for seven years.</p>\n<p>After a move to Bath in 2005 we have undertaken many projects in Somerset and Wiltshire.</p>\n<p>We have recently relocated to Cornwall and our new studio / showroom in Truro is ideally placed to serve our clients on the North and South Coasts of the county.</p>"},galleriesJson:{images:[{title:"",path:"homepage01.jpg"},{title:"",path:"homepage05.jpg"},{title:"",path:"homepage02.jpg"},{title:"",path:"moreton06.jpg"},{title:"",path:"homepage06.jpg"},{title:"",path:"homepage04.jpg"}]}},pathContext:{}}}});
